import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

  render() {
    return (
      <div className="App">
        <header className="App-header">
         <h1>Skimmer</h1>
          <form>
            <p>
            <input type="text" input="Input" placeholder="Input"/>
            <input type="submit" value="Submit" />
            </p>
          </form>
        </header>
      </div>
    );
  }
}

export default App;
